/*
  |  Unicode符号范围      |  UTF-8编码方式
 n |  (十六进制)           | (二进制)
---+-----------------------+------------------------------------------------------
 1 | 0000 0000 - 0000 007F |                                              0xxxxxxx
 2 | 0000 0080 - 0000 07FF |                                     110xxxxx 10xxxxxx
 3 | 0000 0800 - 0000 FFFF |                            1110xxxx 10xxxxxx 10xxxxxx
 4 | 0001 0000 - 0010 FFFF |                   11110xxx 10xxxxxx 10xxxxxx 10xxxxxx
 5 | 0020 0000 - 03FF FFFF |          111110xx 10xxxxxx 10xxxxxx 10xxxxxx 10xxxxxx
 6 | 0400 0000 - 7FFF FFFF | 1111110x 10xxxxxx 10xxxxxx 10xxxxxx 10xxxxxx 10xxxxxx
*/
int enc_get_utf8_size(unsigned char pInput)
{
    unsigned char c = pInput;
    // 0xxxxxxx 返回0
    // 10xxxxxx 不存在
    // 110xxxxx 返回2
    // 1110xxxx 返回3
    // 11110xxx 返回4
    // 111110xx 返回5
    // 1111110x 返回6
    if(c< 0x80) return 0;
    if(c>=0x80 && c<0xC0) return -1;
    if(c>=0xC0 && c<0xE0) return 2;
    if(c>=0xE0 && c<0xF0) return 3;
    if(c>=0xF0 && c<0xF8) return 4;
    if(c>=0xF8 && c<0xFC) return 5;
    if(c>=0xFC) return 6;

    return -1;
}

/*****************************************************************************
 * 将一个字符的UTF8编码转换成Unicode(UCS-2和UCS-4)编码.
 *
 * 参数:
 *    pInput      指向输入缓冲区, 以UTF-8编码
 *    Unic        指向输出缓冲区, 其保存的数据即是Unicode编码值,
 *                类型为unsigned long .
 *
 * 返回值:
 *    成功则返回该字符的UTF8编码所占用的字节数; 失败则返回0.
 *
 * 注意:
 *     1. UTF8没有字节序问题, 但是Unicode有字节序要求;
 *        字节序分为大端(Big Endian)和小端(Little Endian)两种;
 *        在Intel处理器中采用小端法表示, 在此采用小端法表示. (低地址存低位)
 ****************************************************************************/
INT32 gos_encode_utf8_to_unicode(CHAR* pInput, UINT32 *pulUnicode)
{
    CHAR    b1, b2, b3, b4, b5, b6; // b1 表示UTF-8编码的pInput中的高字节, b2 表示次高字节, ...
    INT32   utfbytes;
    UINT8   aucOutput[8];

    if (pInput == NULL || pulUnicode == NULL)
    {
        return 0;
    }

    utfbytes = enc_get_utf8_size(*pInput);
    *pulUnicode = 0x0; // 把 *Unic 初始化为全零

    switch ( utfbytes )
    {
        case 0:
            //*pOutput = *pInput;
            *pulUnicode = *pInput;
            utfbytes += 1;
            break;

        case 2:
            b1 = *pInput;
            b2 = *(pInput + 1);
            if ( (b2 & 0xC0) != 0x80 )
            {
                return 0;
            }

            aucOutput[0] = (b1 << 6) + (b2 & 0x3F);
            aucOutput[1] = (b1 >> 2) & 0x07;
            *pulUnicode = (aucOutput[1]<<8) | aucOutput[0];
            break;

        case 3:
            b1 = *pInput;
            b2 = *(pInput + 1);
            b3 = *(pInput + 2);
            if (((b2 & 0xC0) != 0x80) ||
                ((b3 & 0xC0) != 0x80) )
            {
                return 0;
            }

            aucOutput[0] = (b2 << 6) + (b3 & 0x3F);
            aucOutput[1] = (b1 << 4) + ((b2 >> 2) & 0x0F);

            *pulUnicode = (aucOutput[1]<<8) | aucOutput[0];
            break;

        case 4:
            b1 = *pInput;
            b2 = *(pInput + 1);
            b3 = *(pInput + 2);
            b4 = *(pInput + 3);
            if (((b2 & 0xC0) != 0x80) ||
                ((b3 & 0xC0) != 0x80) ||
                ((b4 & 0xC0) != 0x80) )
            {
                return 0;
            }

            aucOutput[0] = (b3 << 6) + (b4 & 0x3F);
            aucOutput[1] = (b2 << 4) + ((b3 >> 2) & 0x0F);
            aucOutput[2] = ((b1 << 2) & 0x1C)  + ((b2 >> 4) & 0x03);

            *pulUnicode = (aucOutput[2]<<16) | (aucOutput[1]<<8) | aucOutput[0];

            break;

        case 5:
            b1 = *pInput;
            b2 = *(pInput + 1);
            b3 = *(pInput + 2);
            b4 = *(pInput + 3);
            b5 = *(pInput + 4);
            if (((b2 & 0xC0) != 0x80) ||
                ((b3 & 0xC0) != 0x80) ||
                ((b4 & 0xC0) != 0x80) ||
                ((b5 & 0xC0) != 0x80) )
            {
                return 0;
            }

            aucOutput[0] = (b4 << 6) + (b5 & 0x3F);
            aucOutput[1] = (b3 << 4) + ((b4 >> 2) & 0x0F);
            aucOutput[2] = (b2 << 2) + ((b3 >> 4) & 0x03);
            aucOutput[3] = (b1 << 6);

            *pulUnicode = (aucOutput[3]<<24) | (aucOutput[2]<<16) | (aucOutput[1]<<8) | aucOutput[0];

            break;

        case 6:
            b1 = *pInput;
            b2 = *(pInput + 1);
            b3 = *(pInput + 2);
            b4 = *(pInput + 3);
            b5 = *(pInput + 4);
            b6 = *(pInput + 5);
            if (((b2 & 0xC0) != 0x80) ||
                ((b3 & 0xC0) != 0x80) ||
                ((b4 & 0xC0) != 0x80) ||
                ((b5 & 0xC0) != 0x80) ||
                ((b6 & 0xC0) != 0x80) )
            {
                return 0;
            }

            aucOutput[0] = (b5 << 6) + (b6 & 0x3F);
            aucOutput[1] = (b5 << 4) + ((b6 >> 2) & 0x0F);
            aucOutput[2] = (b3 << 2) + ((b4 >> 4) & 0x03);
            aucOutput[3] = ((b1 << 6) & 0x40) + (b2 & 0x3F);

            *pulUnicode = (aucOutput[3]<<24) | (aucOutput[2]<<16) | (aucOutput[1]<<8) | aucOutput[0];

            break;

        default:
            return 0;
    }

    return utfbytes;
}

INT32 gos_encode_unicode_to_utf8(UINT32 ulUnicode, CHAR* szUtf8)
{
    if (!szUtf8)
    {
        return -1;
    }

    if (ulUnicode <= 0x7f)
    {
        szUtf8[0] = ulUnicode;
        szUtf8[1] = '\0';

        return 1;
    }
    else if (ulUnicode <= 0x07ff)
    {
        szUtf8[0] = 0xc0 | (ulUnicode >> 6);
        szUtf8[1] = 0x80 | (ulUnicode & 0x3f);
        szUtf8[2] = '\0';

        return 2;
    }
    else if (ulUnicode <= 0xffff)
    {
        szUtf8[0] = 0xe0 | (ulUnicode >> 12);
        szUtf8[1] = 0x80 | ((ulUnicode >> 6) & 0x3f);
        szUtf8[2] = 0x80 | (ulUnicode & 0x3f);
        szUtf8[3] = '\0';

        return 3;
    }

    *szUtf8 = '\0';
    return -1;
}

