//static HANDLE s_hGB2312CodeMap = NULL;
static CHAR     s_aszGB2312[64*1024][3];
static UINT16   s_ausGB2312[64*1024];   // GET_SHORT("啊") = 41392(=0xa1b0), s_ausGB2312[0xa1b0] = 21834
//static CHAR*  s_ausGB2312String[64*1024];   // GET_SHORT("啊") = 0xa1b0, s_ausGB2312String[0xa1b0] = "啊"

static VOID _init()
{
    static BOOL bInit = FALSE;
    UINT32      ulNum = ARRAY_SIZE(s_astGB2312CodeTable);
    UINT32      i;
    UINT32      ulWordValue;
    static CHAR acAscii[0x80][2];

    if (bInit)
    {
        return;
    }

    memset(s_aszGB2312, 0, sizeof(s_aszGB2312));
    memset(s_ausGB2312, 0, sizeof(s_ausGB2312));
    //memset(s_ausGB2312String, 0, sizeof(s_ausGB2312String));

    for (i=0; i<0x80; i++)
    {
        acAscii[i][0] = i;
        strcpy(s_aszGB2312[i], &acAscii[i][0]);
    }

    for (i=0; i<ulNum; i++)
    {
        ulWordValue = s_astGB2312CodeTable[i].ulWord;

        s_aszGB2312[s_astGB2312CodeTable[i].iCode][0] = (UINT8)ulWordValue;
        ulWordValue >>= 8;
        s_aszGB2312[s_astGB2312CodeTable[i].iCode][1] = (UINT8)ulWordValue;
        s_aszGB2312[s_astGB2312CodeTable[i].iCode][2] = '\0';
    }

    for (i=0; i<ulNum; i++)
    {
        //ulWordValue = GET_SHORT(s_astGB2312CodeTable[i].szWord);
        ulWordValue = s_astGB2312CodeTable[i].ulWord;
        s_ausGB2312[ulWordValue] = s_astGB2312CodeTable[i].iCode;

        //s_ausGB2312String[s_astGB2312CodeTable[i].iCode] = (CHAR*)&s_astGB2312CodeTable[i].acWord;
    }

    bInit = TRUE;

    return;
}

CHAR* gos_unicode_to_ascii(UINT32 ulCode)
{
    _init();

    if (ulCode >= ARRAY_SIZE(s_aszGB2312))
    {
        printf("too large unicode %u\n", ulCode);
        return (CHAR*)"";
    }

    return s_aszGB2312[ulCode];
}

CHAR* gos_utf8_to_ascii_ex(const CHAR *szUtf8, UINT32 ulUtf8Len, CHAR *szAscii)
{
#ifdef _OSWIN32_
    INT32       iWcsLen;
    wchar_t     *wszString;
    INT32       iAnsiLen;
    CHAR        *szOut;

    iWcsLen = MultiByteToWideChar(CP_UTF8, 0, szUtf8, ulUtf8Len, NULL, 0);
    wszString = (wchar_t*)malloc(sizeof(wchar_t)*(iWcsLen + 1));

    MultiByteToWideChar(CP_UTF8, 0, szUtf8, ulUtf8Len, wszString, iWcsLen);
    wszString[iWcsLen] = '\0';

    iAnsiLen = WideCharToMultiByte(CP_ACP, 0, wszString, wcslen(wszString), NULL, 0, NULL, NULL);
    szOut = szAscii;
    if (!szOut)
    {
        szOut = (CHAR*)malloc(iAnsiLen+1);
        if (!szOut)
        {
            free(wszString);
            return NULL;
        }
    }

    WideCharToMultiByte(CP_ACP, 0, wszString, wcslen(wszString), szOut, iAnsiLen, NULL, NULL);
    szOut[iAnsiLen] = '\0';

    free(wszString);

    return szOut;
#else
    UINT32  ulUnicode;
    UINT32  ulLen;
    INT32   iLen;
    INT32   iOffset = 0;
    CHAR    *szOut = szAscii;
    CHAR    *szTmp;

    if (!szOut)
    {
        szOut = (CHAR*)malloc(ulUtf8Len*4+8);
        if (!szOut)
        {
            return NULL;
        }
    }

    *szOut = '\0';
    ulLen = 0;
    //for(;*szUtf8; )
    while(1)
    {
        iLen = gos_encode_utf8_to_unicode((CHAR*)szUtf8+iOffset, &ulUnicode);
        if (iLen <= 0)
        {
            if (!szAscii)
            {
                free(szOut);
            }

            return NULL;
        }

        szTmp = gos_unicode_to_ascii(ulUnicode);
        if (szTmp)
        {
            ulLen += sprintf(szOut+ulLen, "%s", szTmp);
        }
        else
        {
            if (!szAscii)
            {
                free(szOut);
            }

            return NULL;
        }

        iOffset += iLen;
        if (iOffset >= (int)ulUtf8Len)
        {
            break;
        }
        //szUtf8 += iLen;
    }

    return szOut;
#endif
}

CHAR* gos_utf8_to_ascii(const CHAR *szUtf8, CHAR *szAscii)
{
    return gos_utf8_to_ascii_ex(szUtf8, strlen(szUtf8), szAscii);
}

CHAR* gos_ascii_to_utf8(const CHAR *szAscii, CHAR *szUtf8)
{
#ifdef _OSWIN32_
    INT32       iWcsLen;
    wchar_t     *wszString;
    INT32       iLen;
    CHAR        *szOut;

    iWcsLen = MultiByteToWideChar(CP_ACP, 0, szAscii, strlen(szAscii), NULL, 0);
    wszString = (wchar_t*)malloc(sizeof(wchar_t)*(iWcsLen + 1));

    MultiByteToWideChar(CP_ACP, 0, szAscii, strlen(szAscii), wszString, iWcsLen);
    wszString[iWcsLen] = '\0';

    iLen = WideCharToMultiByte(CP_UTF8, 0, wszString, wcslen(wszString), NULL, 0, NULL, NULL);
    szOut = szUtf8;
    if (!szOut)
    {
        szOut = (CHAR*)calloc(1, iLen+1);
        if (!szOut)
        {
            free(wszString);
            return NULL;
        }
    }

    WideCharToMultiByte(CP_UTF8, 0, wszString, wcslen(wszString), szOut, iLen, NULL, NULL);
    szOut[iLen] = '\0';

    free(wszString);

    return szOut;
#else
    UINT32  ulUnicode = 0;
    CHAR    *szOut = szUtf8;
    CHAR    *szTmp;
    UINT32  ulLen = strlen(szAscii);
    CHAR    *szEnd = (CHAR*)szAscii + ulLen;
    UINT32  ulAscii;

    _init();

    if (szAscii == szUtf8)
    {
        return NULL;
    }

    if (!szOut)
    {
        szOut = (CHAR*)malloc(ulLen*2);
        if (!szOut)
        {
            return NULL;
        }
    }

    szTmp = szOut;
    //while(*szAscii != '\0')
    while (szAscii < szEnd)
    {
        if (((UINT32)*szAscii) < 0x80)
        {
            *szTmp++ = *szAscii++;
        }
        else
        {
            ulAscii = (UINT8)szAscii[1];
            ulAscii = (ulAscii<<8) | ((UINT8)szAscii[0]);
            ulUnicode = s_ausGB2312[ulAscii];   //GET_SHORT(szAscii);
            if (ulUnicode > 0)
            {
                szTmp += gos_encode_unicode_to_utf8(ulUnicode, szTmp);
            }

            szAscii += 2;
        }
    }

    *szTmp = '\0';

    return szOut;
#endif
}

BOOL gos_file_utf8_to_ascii(const CHAR *szFile, const CHAR *szNewFile)
{
    BOOL            bRet = FALSE;
    HANDLE          hFile = NULL;
    UINT32          ulLen = 0;
    CHAR            *szFileText = NULL;
    CHAR            *szNewFileText = NULL;

    hFile = gos_fopen(szFile, "rb");
    if (!hFile)
    {
        return FALSE;
    }

    ulLen = gos_get_fsize(hFile);

    szFileText = (CHAR*)calloc(1, ulLen+1);
    if (!szFileText)
    {
        goto end;
    }

    if ((INT32)ulLen != gos_fread(hFile, szFileText, ulLen))
    {
        goto end;
    }

    szNewFileText = gos_utf8_to_ascii(szFileText, NULL);
    if (!szNewFileText)
    {
        goto end;
    }

    gos_fclose(hFile);

    hFile = gos_fopen(szNewFile, "w+b");
    if (!hFile)
    {
        goto end;
    }

    ulLen = strlen(szNewFileText);
    if ((INT32)ulLen != gos_fwrite(hFile, szNewFileText, ulLen))
    {
        goto end;
    }

    bRet = TRUE;

end:
    gos_fclose(hFile);

    if (szFileText)
    {
        free(szFileText);
    }

    if (szNewFileText)
    {
        free(szNewFileText);
    }

    return bRet;
}

VOID gos_dir_utf8_to_ascii(const CHAR *szDir, const CHAR *szNewDir, BOOL bConvertSubDir)
{
    HANDLE          hDir = NULL;
    CHAR            acFile[512];
    CHAR            acNewFile[512];
    CHAR            *szNewFile;
    UINT32          ulDirLen;
    BOOL            bIsDir;

    hDir = gos_open_dir(szDir);
    if (!hDir)
    {
        return;
    }

    ulDirLen = strlen(szNewDir);
    strcpy(acNewFile, szNewDir);
    if (acNewFile[ulDirLen] == '\\' || acNewFile[ulDirLen] == '/')
    {
        acNewFile[ulDirLen] = '\0';
    }

    szNewFile = acNewFile + strlen(acNewFile);

    ulDirLen = strlen(szDir);
    if (szDir[ulDirLen] == '\\' || szDir[ulDirLen] == '/')
    {
        ulDirLen --;
    }

    while(gos_get_next_file(hDir, acFile, &bIsDir))
    {
        strcpy(szNewFile, acFile + ulDirLen);

        if (bIsDir)
        {
            gos_create_redir(acNewFile);
            gos_dir_utf8_to_ascii(acFile, acNewFile, bConvertSubDir);
        }
        else
        {
            gos_file_utf8_to_ascii(acFile, acNewFile);
        }
    }
}

// 四字节Hex字符串转换成整数
static BOOL gos_4hexchar_to_uint(const CHAR *szHex, UINT32 *pulValue)
{
    UINT8   *pucHex = (UINT8*)szHex;
    UINT32  ulValue;
    UINT32  i;

    pulValue[0] = 0;

    for (i=0; i<4; i++)
    {
        ulValue = gos_hex_to_byte(pucHex[i]);
        if (ulValue > 0x0f)
        {
            return FALSE;
        }

        pulValue[0] = (pulValue[0]<<4) | ulValue;
    }

    return TRUE;
}

