static UINT32   s_astUnicodeToString[0xffff+1];
static UINT32   s_astStringToUnicode[0xffff+1];
static BOOL     s_bInitUnicodeTable = FALSE;

static VOID _init_unicode_table()
{
    UINT32      i = 0;

    if (s_bInitUnicodeTable)
    {
        return;
    }

    memset(s_astUnicodeToString, 0, sizeof(s_astUnicodeToString));
    memset(s_astStringToUnicode, 0, sizeof(s_astStringToUnicode));

    for (i=0; i<ARRAY_SIZE(s_astUnicode); i++)
    {
        s_astUnicodeToString[s_astUnicode[i][0]] = s_astUnicode[i][1];
        s_astStringToUnicode[s_astUnicode[i][1]] = s_astUnicode[i][0];
    }

    s_bInitUnicodeTable = TRUE;
}

#define INIT_UNICODE_TABLE      if (!s_bInitUnicodeTable){_init_unicode_table();}

UINT32 gos_unicode_to_string(UINT16 usUnicode, CHAR *szText)
{
    INIT_UNICODE_TABLE;

    if (usUnicode < 0x80)
    {
        //sprintf(szText, "%c", usUnicode);
        szText[0] = (UINT8)usUnicode;
        szText[1] = '\0';

        return 1;
    }
    else
    {
        szText[0] = (CHAR)(s_astUnicodeToString[usUnicode] >> 8);
        szText[1] = (CHAR)(s_astUnicodeToString[usUnicode] & 0xff);
        szText[2] = '\0';

        if (szText[0] == '\0')
        {
            return 0;
        }

        return 2;
    }
}

// 4E2D003156FD0032 -> 中1国2
BOOL gos_unicode_hexchar_to_string(const CHAR *szHex, CHAR *szText)
{
    UINT32      ulHexValue;
    UINT32      i;
    UINT32      ulLen = strlen(szHex);

    INIT_UNICODE_TABLE;

    if (MOD(ulLen, 4) != 0)
    {
        return FALSE;
    }

    for (i=0; i<ulLen; i+=4, szHex+=4)
    {
        if (!gos_4hexchar_to_uint(szHex, &ulHexValue) || ulHexValue > 0xffff)
        {
            return FALSE;
        }

        szText += gos_unicode_to_string(ulHexValue, szText);
        /*if (ulHexValue < 0x80)
        {
            //szText += sprintf(szText, "%c", ulHexValue);
            *szText++ = (CHAR)ulHexValue;
        }
        else
        {
            *szText++ = (CHAR)(s_astUnicodeToString[ulHexValue] >> 8);
            *szText++ = (CHAR)(s_astUnicodeToString[ulHexValue] & 0xff);
        }*/
    }

    *szText = '\0';

    return TRUE;
}

UINT16 gos_string_to_unicode(CHAR *szText)
{
    UINT8       *pucText = (UINT8*)szText;
    UINT32      ulWordValue;

    INIT_UNICODE_TABLE;

    if (*pucText < 0x80)
    {
        // "1" -> 0x31
        return *pucText;
    }
    else // "中 -> 4E2D
    {
        ulWordValue = (pucText[0] << 8) | pucText[1];

        return s_astStringToUnicode[ulWordValue];
    }
}

// 中1国2 -> 4E2D003156FD0032
VOID gos_string_to_unicode_hexchar(const CHAR *szText, CHAR *szHex)
{
    UINT32      ulWordValue;
    UINT8       *pucText = (UINT8*)szText;

    INIT_UNICODE_TABLE;

    while(*pucText != '\0')
    {
        if (*pucText < 0x80)
        {
            // "1" -> 0031
            szHex += sprintf(szHex, "%04X", *pucText);
            pucText++;
        }
        else // "中 -> 4E2D
        {
            ulWordValue = (pucText[0] << 8) | pucText[1];
            ulWordValue = s_astStringToUnicode[ulWordValue];

            szHex += sprintf(szHex, "%04X", ulWordValue);
            pucText += 2;
        }
    }

    return;
}

